contracts/MultiSigWallet.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.10;


contract MultiSigWallet{

    event Deposit(address,uint);

    address[] public owners;
    uint private required;
    mapping(uint => mapping(address => bool)) public approval;

    struct Transaction{
        address to;
        uint value;
        bool executed;

    }

    Transaction[] public transactions;

    constructor(uint _required) {
        owners.push(msg.sender);
        required = _required;
    }


    receive() external payable{
        emit Deposit(msg.sender ,msg.value);
    }

    function makeTransaction(address _to, uint _value) external {
        transactions.push(Transaction(_to,_value,false));
    }
}

